              }}></path></svg></span>{`Public Preview`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`LiveData Migrator is in public preview. This gives you access to all product functionality for review, but limits operation time to 10 minutes during the preview period.`}</p></div></div>
    <p>{`Here, you'll find information about how to interact with LiveData Migrator to create and manage resources that control your migrations.`}</p>
    <p>{`If you're new to the concept of LiveData, or want to know what LiveData Migrator does, please read the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/"
      }}>{`introduction to LiveData Migrator`}</a>{` before learning `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/getting-started"
      }}>{`how to install`}</a>{` and use the product.`}</p>
    <h2 {...{
      "id": "operating-livedata-migrator"
    }}>{`Operating LiveData Migrator`}</h2>
    <p>{`Control how LiveData Migrator performs migrations using commands at the action prompt `}<inlineCode parentName="p">{`WANdisco LiveMigrator >>`}</inlineCode>{`. The prompt is available immediately when you run LiveData Migrator from the command line.`}</p>
    <p>{`If you are running it as a system service, you will need to `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/configuration#ssh-access"
      }}>{`configure`}</a>{` and use SSH to access the action prompt. By default, SSH access is insecure, with username `}<inlineCode parentName="p">{`user`}</inlineCode>{`, and password `}<inlineCode parentName="p">{`password`}</inlineCode>{` on port 2222.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-text"
      }}>{`$ ssh user@localhost -p 2222
`}</code></pre>
    <p>{`Change this using the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/configuration#ssh-access"
      }}>{`configuration properties`}</a>{` for SSH access to:`}</p>
    <ol>
      <li parentName="ol"><strong parentName="li">{`Comment out the SSH password configuration property`}</strong>{` `}<inlineCode parentName="li">{`ssh.shell.password`}</inlineCode>{` so that password access is disabled, and`}</li>
      <li parentName="ol"><strong parentName="li">{`Specify an authorized keys file`}</strong>{` with `}<inlineCode parentName="li">{`ssh.shell.authorized-public-keys-file`}</inlineCode>{` to allow access only from authorized clients that hold a matching private key.`}</li>
    </ol>
    <h3 {...{
      "id": "interactive-commands"
    }}>{`Interactive Commands`}</h3>
    <p>{`The action prompt provides many features to guide you during operation, including:`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Feature`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`How to use it`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Interactive help`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Type `}<inlineCode parentName="td">{`help`}</inlineCode>{` at the action prompt.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Review available commands`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Commands that cannot be used without creating other resources first are tagged with `}<inlineCode parentName="td">{`*`}</inlineCode>{` in the output of the `}<inlineCode parentName="td">{`help`}</inlineCode>{` command.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Command completion`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Hit the `}<inlineCode parentName="td">{`<tab>`}</inlineCode>{` key at any time to get assistance or to complete partially-entered commands.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Cancel input`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Type `}<inlineCode parentName="td">{`<Ctrl-C>`}</inlineCode>{` before entering a command to return to an empty action prompt.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Syntax indication`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Invalid commands are highlighted as you type.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Clear the display`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Type `}<inlineCode parentName="td">{`<Ctrl-L>`}</inlineCode>{` at any time.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Show command history`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Type `}<inlineCode parentName="td">{`history`}</inlineCode>{` at the action prompt.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Previous commands`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Navigate previous commands using the up and down arrows, and use standard emacs shortcuts.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><strong parentName="td">{`Interactive or scripted operation`}</strong></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`You can interact with the command line interface directly, or send it commands on standard input to incorporate it into shell scripts.`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "livedata-migrator-resources"
    }}>{`LiveData Migrator Resources`}</h3>
    <p>{`You define three different types of resources when operating LiveData Migrator:`}</p>
    <p><strong parentName="p">{`File systems`}</strong>{`: Create and manage file system resources to specify how LiveData Migrator connects to and uses file systems as migration sources and targets.`}</p>
    <p><strong parentName="p">{`Migrations`}</strong>{`: Initiate data migration by creating migration resources. A migration references the source and target file system resources, and adds additional information to specify the path for content to be migrated, and may reference exclusion resources.`}</p>
    <p><strong parentName="p">{`Exclusions`}</strong>{`: Constrain the content migrated by creating and referencing exclusion resources. Use different types of exclusions to enforce constaints with different conditions, e.g. by file size or by a regular expression match against the file name.`}</p>
    <h2 {...{
      "id": "livedata-migrator-commands"
    }}>{`LiveData Migrator Commands`}</h2>
    <p>{`There are five types of commands in LiveData Migrator: `}<em parentName="p">{`Built-in`}</em>{`, `}<em parentName="p">{`Exclusion`}</em>{`, `}<em parentName="p">{`File System`}</em>{`, `}<em parentName="p">{`Migration`}</em>{` and `}<em parentName="p">{`Source`}</em>{` commands.  Each will respond with either JSON-formatted output, or with plain text output. You can find a summary of those commands here, each of which links to details in the `}<a parentName="p" {...{
        "href": "/live-data-migrator/docs/command-reference"
      }}>{`LiveData Migrator Command Reference`}</a>{`.`}</p>
    <p>{`Find a full list of commands that can be used at the action prompt with the `}<inlineCode parentName="p">{`help`}</inlineCode>{` command. Get command specific help by typing `}<inlineCode parentName="p">{`help <command>`}</inlineCode>{` for each command available.`}</p>
    <p>{`Use tab-completion to become familar with the commands available and options that should be provided to them. Type the `}<inlineCode parentName="p">{`<tab>`}</inlineCode>{` key if you are uncertain whether a command requires an additional parameter, or if you need to provide a specific value. It will help auto-complete parameter values, and display options available for any command.`}</p>
    <h3 {...{
      "id": "built-in-commands"
    }}><a parentName="h3" {...{
        "href": "/live-data-migrator/docs/command-reference#built-in-commands"
      }}>{`Built-In Commands`}</a></h3>
    <p>{`The built-in commands are always available in a LiveData Migrator command line interactive session. They are unrelated to migration resources and operation (other than `}<inlineCode parentName="p">{`exit`}</inlineCode>{`/`}<inlineCode parentName="p">{`quit`}</inlineCode>{`), but help you to interact with LiveData Migrator and automate processing through scripts for the action prompt.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Action`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#clear"
            }}><inlineCode parentName="a">{`clear`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Clear the shell screen`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exit"
            }}><inlineCode parentName="a">{`exit`}</inlineCode></a>{`/`}<a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exit"
            }}><inlineCode parentName="a">{`quit`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Exit the interactive session with the action prompt, and stop LiveData Migrator if not running as a system service. You can also exit the session with `}<inlineCode parentName="td">{`<Ctrl-D>`}</inlineCode>{`.`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#help"
            }}><inlineCode parentName="a">{`help`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Display help about available commands`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#history"
            }}><inlineCode parentName="a">{`history`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Display or save the history of previously run commands`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#script"
            }}><inlineCode parentName="a">{`script`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Read and execute commands from a file`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#stacktrace"
            }}><inlineCode parentName="a">{`stacktrace`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Display the full stacktrace of the last error`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "exclusion-commands"
    }}><a parentName="h3" {...{
        "href": "/live-data-migrator/docs/command-reference#exclusion-commands"
      }}>{`Exclusion Commands`}</a></h3>
    <p>{`Define exclusion resources to constrain the content migrated by a migration resource. Different types of exclusions allow you to selectively ignore content from the source file system so that you have full control over what is transferred to, and modified in the target during migration. Exclusions need to be associated with migrations to take effect for them. You can do this when you create a migration resource, or associate exclusions with an existing migration.`}</p>
    <p>{`Modifying exclusions on a migration that is in progress will change the future actions performed for that migration, but will not affect previously migrated content. Adding exclusions when a migration is created ensures a migration outcome consistent in full with those exclusions.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Action`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exclusion-add-file-size"
            }}><inlineCode parentName="a">{`exclusion add file-size`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Create a new file size rule`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exclusion-add-regex"
            }}><inlineCode parentName="a">{`exclusion add regex`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Create a new regex exclusion rule`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exclusion-del"
            }}><inlineCode parentName="a">{`exclusion del`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Delete an exclusion rule`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exclusion-list"
            }}><inlineCode parentName="a">{`exclusion list`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`List all exclusion rules`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#exclusion-show"
            }}><inlineCode parentName="a">{`exclusion show`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Get details for a particular exclusion rule`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "file-system-commands"
    }}><a parentName="h3" {...{
        "href": "/live-data-migrator/docs/command-reference#file-system-commands"
      }}>{`File System Commands`}</a></h3>
    <p>{`Create file system resources to provide LiveData Migrator with the information needed to read content from your source and migrate content to your target. A range of different file system types are supported as targets, including `}<a parentName="p" {...{
        "href": "https://docs.microsoft.com/en-us/azure/storage/blobs/data-lake-storage-introduction"
      }}>{`ADLS Gen 2`}</a>{`, `}<a parentName="p" {...{
        "href": "https://hadoop.apache.org/docs/current/hadoop-project-dist/hadoop-hdfs/HdfsDesign.html"
      }}>{`HDFS`}</a>{`, local file systems, and `}<a parentName="p" {...{
        "href": "https://hadoop.apache.org/docs/current/hadoop-aws/tools/hadoop-aws/index.html"
      }}>{`S3A`}</a>{`. LiveData Migrator currently supports HDFS file systems as a migration source.`}</p>
    <p>{`You can define multiple target file systems, and have migrations operating at the same time to them.`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Command`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Action`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-add-adls2-sharedkey"
            }}><inlineCode parentName="a">{`filesystem add adls2 sharedKey`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Add an ADLS Gen 2 file system resource`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-add-hdfs"
            }}><inlineCode parentName="a">{`filesystem add hdfs`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Add a Hadoop HDFS file system resource`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-add-local"
            }}><inlineCode parentName="a">{`filesystem add local`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Add a local file system resource`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-add-s3a"
            }}><inlineCode parentName="a">{`filesystem add s3a`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Add an S3 file system resource`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-clear"
            }}><inlineCode parentName="a">{`filesystem clear`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Delete all target file systems`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-del"
            }}><inlineCode parentName="a">{`filesystem del`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Delete a target file system`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-list"
            }}><inlineCode parentName="a">{`filesystem list`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`List of target file systems`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-show"
            }}><inlineCode parentName="a">{`filesystem show`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`Get target file system details`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}><a parentName="td" {...{
              "href": "/live-data-migrator/docs/command-reference#filesystem-types"
            }}><inlineCode parentName="a">{`filesystem types`}</inlineCode></a></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`List the types of target file systems available`}</td>
        </tr>
      </tbody>
    </table>
    <h3 {...{
      "id": "migration-commands"
    }}><a parentName="h3" {...{
